import React, { Component } from "react";
import classes from "./Home.module.css";
import LoginForm from './LoginForm/LoginForm';

class Home extends Component {
    state = {
        loggining: true,
        status: null
    }

    disableLoginForm = () => {
        this.setState({loggining: false});
    }

    render() {
        return (
            <div className={classes.Home}>
                <LoginForm visible={this.state.loggining} enableRegularMode={this.disableLoginForm}/>
                {this.state.status ?
                    <React.Fragment>
                        <p>User Info...</p>
                        {this.state.status === "admin" ?
                            <p>List of users</p> 
                        : null}
                    </React.Fragment> 
                : null}
            </div>
        );
    }
}

export default Home;
